import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 495.87,
      Date: new Date(2022, 8, 14),
    },
    {
      id: "e2",
      title: "Toilet Paper",
      amount: 595.87,
      Date: new Date(2022, 6, 24),
    },
    {
      id: "e3",
      title: "Room Rent",
      amount: 695.87,
      Date: new Date(2022, 2, 18),
    },
    {
      id: "e4",
      title: "Groceries",
      amount: 295.87,
      Date: new Date(2022, 10, 21),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
